import React, {Component} from 'react';
import { Container } from 'react-bootstrap';
import DataTable from '../../scripts/Datatable'

class Warga extends Component{
    constructor(props){
        super(props);
    }
    render(){
    const columns = [
        {
        name: "NO",
        selector: "serial",
        sortable: true
        },
        {
        name: "Peran",
        selector: "peran",
        sortable: true
        },
        {
        name: "Nik",
        selector: "nik",
        sortable: true
        }
        ,
        {
        name: "Nama",
        selector: "nama",
        sortable: true,
        right: true
        }
        ,
        {
        name: "Tempat Lahir",
        selector: "tmp_lahir",
        sortable: true,
        right: true
        }
        ,
        {
        name: "Tanggal Lahir",
        selector: "tgl_lahir",
        sortable: true,
        right: true
        }
        ,
        {
        name: "Rumah",
        selector: "rumah",
        sortable: true,
        right: true
        }
        ,
        {
        name: "Status",
        selector: "status",
        sortable: true,
        right: true
        }
        ,
        {
        name: "Act",
        selector: "act",
        sortable: true,
        right: true
        }
        // ,
        // {
        // name: "Runtime (m)",
        // selector: "user_id",
        // sortable: true,
        // right: true
        // }
    ];

    const data =[
        {
        'title': 'Testing 1',
        'director': 'Yusup S',
        'runtime': 'test'
        }
    ];
        return(
            <div className="content-wrapper">
                <div className="content-header">
                    <div className="container-fluid">
                        <div className="row mb-2">
                        <div className="col-sm-6">
                            <h1 className="m-0 text-dark">Master Warga</h1>
                        </div>{/* /.col */}
                        <div className="col-sm-6">
                            <ol className="breadcrumb float-sm-right">
                            <li className="breadcrumb-item"><a href="#">Master</a></li>
                            <li className="breadcrumb-item active">Warga</li>
                            </ol>
                        </div>{/* /.col */}
                        </div>{/* /.row */}
                    </div>{/* /.container-fluid */}
                </div>
                <div className="content">
                    <div className="card">
                        {/* <div className="card-header"></div> */}
                        <div className="card-body">
                            <div className="row">
                                <div className="col-md-12">
                                    <DataTable title="Test" columns={columns}  data={data} />
                                </div>
                            </div>
                        </div>
                    </div>
                </div>
            </div>
        );
    }
}

export default Warga;
